import React from 'react';

//function Greet() {
//    return <h1>Hello Vishwas</h1>
//}

const Jono = props => {
  const { name, divi } = props;
  return (
    <div>
      <h1>
        Hello {name} a.k.a {divi}
      </h1>
    </div>
  );
};


export default Jono
